import React from 'react';
import detail from "./data/productDetail.js"
import "./Boxb.css"
import LikeButton from "./LikeButton";

import {
    StyledBox,
    TextContainer,
} from "./styled"
// import EachProduct from './pages/EachProduct.js';

const Boxb = () => {

    return <>{detail.detailProd.map((product)=>(
        <>
        <EachProduct
            key={product.id} 
            title={product.title} 
            detailID={product.id}
        >
            <StyledBox key={product.id}>
                <img src={product.img} alt="no imag"></img>

                    <textitem>
                        <p><b>{product.title}</b></p>
                        <p className="address"> {product.address}</p>
                        <TextContainer>
                            <p className="price"> {product.price}</p>
                            <LikeButton />
                        </TextContainer>


                        {/* <EachProduct  
                            key={product.id} 
                            title={product.title} 
                            detailID={product.id}/> */}
                    </textitem>


            </StyledBox>
            </EachProduct>
        </>
        ))}
        </>

};

export default Boxb
